import React, { Component } from 'react';
import { Api, JsonRpc, RpcError } from 'eosjs';
import axios from 'axios';


class Navbar extends Component {

    constructor(props){
        super(props);
    }

  render() {

    const resp = new JsonRpc('https://api.eosnewyork.io/v1/chain');
    console.log(resp);

    const title = (
        <h1>Hello world</h1>
    );

    return (
        <div>
            <div className="row">
                <div className="col-md-12 text-center">
                    <h3 className="display-4 mb-4">Block.one development test</h3>
                </div>
            </div>
        </div>
    )
  }
}



export default Navbar;
